import React from 'react';

function Scroll(props) {
	return (
		<div 
			style={{overflowY: 'scroll', border: '1px solid grey', height: '50%'}}
			className='absolute bottom-0'
		>
			{props.children}
		</div>
	);
};

export default Scroll;
